--
-- Table structure for table `eload_order_goods`
--

DROP TABLE IF EXISTS `eload_order_goods`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `eload_order_goods` (
  `rec_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(10) unsigned NOT NULL DEFAULT '0',
  `child_order_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '子订单id',
  `goods_id` int(10) unsigned NOT NULL DEFAULT '0',
  `goods_name` varchar(250) NOT NULL,
  `goods_sn` varchar(60) NOT NULL DEFAULT '',
  `goods_number` smallint(5) unsigned NOT NULL DEFAULT '1',
  `market_price` decimal(10,2) NOT NULL DEFAULT '0.00',
  `goods_price` decimal(10,2) NOT NULL DEFAULT '0.00',
  `goods_pay_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '单个sku的商品总金额',
  `goods_pay_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品实际支付金额',
  `goods_attr` text NOT NULL,
  `custom_size` text,
  `send_number` smallint(5) unsigned NOT NULL DEFAULT '0',
  `goods_off` int(11) NOT NULL DEFAULT '0',
  `lmt_num` tinyint(1) NOT NULL DEFAULT '0',
  `addtime` int(11) NOT NULL DEFAULT '0',
  `attr_goods_sn` varchar(500) DEFAULT NULL,
  `is_dao` int(11) NOT NULL DEFAULT '0',
  `point_rate` int(11) DEFAULT '1',
  `goods_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '商品销售类型（0：普通商品，1：促销商品）',
  `free_shipping_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '免邮商品包含的香港小包运费',
  `shipping_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '非免邮运费',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '记录修改时间',
  `wj_linkid` int(11) NOT NULL DEFAULT '0',
  `wj_linkid_source` tinyint(1) NOT NULL DEFAULT '0' COMMENT '链接来源，0：未定，1：web,2:mobile',
  `is_review` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '评论状态：0未评论，1文字评论，2有图评论',
  `zaful_source` varchar(50) NOT NULL DEFAULT '' COMMENT '记录商品的来源，recommended：弹窗推荐商品（后续的来源统计之类的都可以用这个字段）',
  `delivery_level` tinyint(3) DEFAULT '2' COMMENT '发货时间等级',
  `isUsedDealsCoupon` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否使用了deals coupon',
  `grade_code` tinyint(4) NOT NULL DEFAULT '0' COMMENT '产品等级,1=>热卖,2=>潜力,3=>新品,4=>平销,5=>滞销',
  PRIMARY KEY (`rec_id`),
  KEY `order_id` (`order_id`),
  KEY `goods_id` (`goods_id`),
  KEY `goods_sn` (`goods_sn`),
  KEY `zaful_source` (`zaful_source`),
  KEY `idx_sn_num` (`goods_sn`,`goods_number`),
  KEY `idx_goods_price` (`goods_price`),
  KEY `idx_update_time` (`update_time`),
  KEY `idx_child_order_id` (`child_order_id`)
) ENGINE=InnoDB AUTO_INCREMENT=27082817 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

